                 SaltBae50 brings you amazing flavors in Salt Nic form. The Series brings your favorite Salt Bae 50 original flavors of sweet fruit combination. Enjoy each moment with a fruity taste.SaltBea50 Salt Nic Series Features:       30mL Chubby Bottle       Dropper In Bottle       Nicotine Salts Formulation       Crafted For Ultra-Low
Wattage & Pod-Based System       Available nicotine: 25mg,
50mg       Made in USASaltBea50 Salt Nic Series Flavors:Blue Raspberry Lemonade -  delivers an exhilarating blue raspberry lemonade with the perfect amount of tanginess and a refreshing flavor.Strawberry Kiwi - The perfect pairing of ripe strawberries and exotic, tart kiwi is well known for how incredibly complementary they are to each other. Juicy Watermelon - infuses juicy summertime watermelons with an invigorating hint of the winter.Fresh Pineapple - The fresh pineapple fruit in this salt e liquid will make you feel as if you are having an iconic fruity cocktail by the beach. Green Apple - takes ripe Granny Smith apples and combines them with premium nicotine salts to create a mouth-puckering tart apple flavor.Red Mango - a phenomenal freshly ripe mangos with a distinct taste unlike any other.Caramel Tobacco -  Strong, deep tobacco is mellowed out by the sweet, buttery taste that brings out the best of its natural, earthy flavor. Inhale for a silky smooth, seductive blend that's a staple in any vape juice collection. Georgia Peach - Georgia Peach by Salt Bae tastes like a ripe Peach directly from the farms of Georgia grown to perfection! Enjoy this sweet yet subtle peach flavored vape juice that you simply will not be able to get enough of.Fruit Punch - This is that, but for adults. A combination of your favorite fruits that conjure up the most nostalgic beverage of all time. Splash into a bottle of fruit punch today! Strawberry Acai - This is sunshine shaken in a bottle. Sweet, crisp, tangy, and bursting with strawberry and acai flavors. The Strawberry Açaí is your afternoon made.Oatmeal Cream Pie Cookie - Mashmellow goodness squeezed between two soft oatmeal cookies. Oatmeal Cream Pie Cookie will take you back to the simpler times.Carrot Cake - The moist, sweet, fresh spice cake we all know topped with decadent cream cheese frosting. Your taste buds will love Carrot Cake.**Warning: Not For Sub-Ohm Use**CALIFORNIA PROPOSITION 65 - Warning: This product contains
